  		4779,
  		"World's Best Comics",
  		"1947",
  		"1947",
      "This slogan appears by itself in very plain text on the front (but not the back) of a single 1947 one-shot (Everybody's Comics).  The same slogan paired with \"Great Comic Library\" and a \"GCL\" logo was used on the backs of various 1944 Wm. H. Wise-published one-shots as well as the 1946 issues of Everybody's Comics one of which recycled the 1944 cover and the other of which paired those slogans with the more familiar winking foxhead and was actually published by Fox Feature Syndicate.",
      NULL,
      74
      );INSERT INTO brand_group(id, name, year_began, year_ended, notes, website_id, publisher_id) VALUES(
