      112
      );INSERT INTO brand_group(id, name, year_began, year_ended, notes, website_id, publisher_id) VALUES(
  		4782,
  		"World's Greatest Comics / A Dynamic Publication; Harry \"A\" Chesler Features Syndicate N.Y.",
  		"1941",
  		"1942",
      "Chesler's brand during his immediate pre-war publishing activities.  \"World's Greatest Comics\" is the prominent logo that would return after the war.  However pre-war issues said \"A Dynamic Publication\" in small letters above that and also carred the 'Harry \"A\" Chesler Features Syndicate N.Y.' small text elsewhere on the cover.",
      NULL,
      112
      );INSERT INTO brand_group(id, name, year_began, year_ended, notes, website_id, publisher_id) VALUES(
  		4783,
  		"World's Greatest Comics / Harry \"A\" Chesler Jr.",
  		"1944",
  		"1946",
      "This is the logo used on most of Chesler's post-War publications.  The \"World's Greatest Comics\" portion is the most prominent but unlike the pre-war logo the small text above it now reads \"Harry \"A\" Chesler Jr.\" instead of \"A Dynamic Publication\" and there is no separate text about Chesler's \"Features Sydicate\" anywhere on the cover.",
      NULL,
      112
      );INSERT INTO brand_group(id, name, year_began, year_ended, notes, website_id, publisher_id) VALUES(
